import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/signUpPage.css'

function SignUpPage ( ) {
    const navigate = useNavigate();

    const handleHomeClick = () => {
        navigate('/');
    };

    return (
        <div className="signUpContainer">
            <h1>펫토리</h1>
            <p>회원가입 페이지임</p>
            <div className='signUpFull'>
            <form>
                    <div className="loginFormGroup">
                        <label htmlFor="name">이름</label>
                        <input type="text" id="name" name="name" required />
                    </div>
                    <div className="signUpFormGroup">
                        <label htmlFor="e-mail">이메일</label>
                        <input type="text" id="e-mail" name="e-mail" required />
                    </div>
                    <div className="signUpFormGroup">
                        <label htmlFor="password">비밀번호</label>
                        <input type="password" id="password" name="password" required />
                    </div>
                    <div className="signUpFormGroup">
                        <label htmlFor="phoneNum">휴대폰번호 (- 제외)</label>
                        <input type="tel" id="phoneNum" name="phoneNum" required />
                    </div>
                    <div className="signUpButtonGroup">
                        <button type="button" onClick={handleHomeClick}>취소</button>
                        <button type="submit">확인</button>
                    </div>
            </form>
            </div>
        </div>
    );
}

export default SignUpPage;
